   // El rol esperado sera expectedRol\n    const expectedRol = route.data.expectedRol;\n    this.realRol = this.tokenService.isAdmin() ? 'admin' : 'user';\n    // Comprobamos si el rol esperado es el real\n    if (!this.tokenService.isLogged() || expectedRol.indexOf(this.realRol) \n        \n\n\n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interceptors/ProdInterceptorService.html":{"url":"interceptors/ProdInterceptorService.html","title":"interceptor - ProdInterceptorService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Interceptors\n  ProdInterceptorService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/components/interceptors/prod-interceptor.service.ts\n        \n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                    Private\n                                addToken\n                            \n                            \n                                intercept\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(tokenService: TokenService, authService: AuthService)\n                    \n                \n                        \n                            \n                                Defined in src/app/components/interceptors/prod-interceptor.service.ts:14\n                            \n                        \n\n                \n                    \n                            \n               